script: |
  super -f text -I q4368.spq | sort > q4368.out

inputs:
  - name: q4368.spq
    data: |
      SELECT DISTINCT col1 FROM tab2 (FORMAT parquet) WHERE - - col1 + + col2 BETWEEN col1 + + col1 + - + col2 + - - 59 * - 66 AND ( + col0 ) - - col2;
  - name: tab2

outputs:
  - name: q4368.out
    data: |
      67
